	<meta http-equiv="X-UA-Compatible" content="IE=Edge">
	<meta http-equiv="cache-control" content="max-age=0" />
	<meta http-equiv="cache-control" content="no-cache" />
	<meta http-equiv="expires" content="0" />
	<meta http-equiv="expires" content="Tue, 01 Jan 1980 1:00:00 GMT" />
	<meta http-equiv="pragma" content="no-cache" />
	<title>VueGenerator - 404</title>
	<meta name="description" content="">
	<meta name="viewport" content="width=device-width, initial-scale=1">
	<link rel="shortcut icon" type="image/x-icon" href="favicon.ico">
	<link rel="stylesheet" href="css/font.css" />
	<link rel="stylesheet" href="vendor/css/reset.css" />
	<link rel="stylesheet" href="vendor/css/vuebar.css" />
	<link rel="stylesheet" href="css/desktop.css" />
	<link rel="stylesheet" href="css/mobile.css" media="(max-width: 1024px)" />
	<script>
		(function() {
			function initScope(meta) {
				return {BaseUrl: baseUrl, compMap: {}, meta: meta, scopes: scopes};
			}
			var baseUrl = "";
			var scopes = {
				"App":{"JS_GLOBAL":"_app$","PREFIX":"app","COMP_PATH_PREFIX":"app/comp/","NAME":"App"},
				"VComp":{"JS_GLOBAL":"_vcomp$","PREFIX":"vcomp","COMP_URL":"https://unpkg.com/@arijs/frontend@0.1.2/vcomp/","NAME":"VComp"},
				"Global":{"JS_GLOBAL":"_var$","NAME":"Global"}
			};
			this._app$ = initScope(scopes.App);
			this._vcomp$ = initScope(scopes.VComp);
			this._var$ = initScope(scopes.Global);
			this._app$.compInit = [{"MOUNT":"#mount","ID":"app/root","SAVE":"$root"}];
		})();
	</script>
</head>
<body>
	<div id="mount">
		<h1>404</h1>
		<h2>Página não encontrada</h2>
	</div>
	<script src="https://unpkg.com/@arijs/frontend@0.1.2/utils/javascript.js"></script>
	<script src="https://unpkg.com/@arijs/frontend@0.1.2/utils/loaders.js"></script>
	<script src="https://unpkg.com/@arijs/frontend@0.1.2/utils/form.js"></script>
	<script src="https://unpkg.com/@arijs/frontend@0.1.2/utils/string.js"></script>
	<script src="https://unpkg.com/@arijs/frontend@0.1.2/utils/animation.js"></script>
	<script src="https://unpkg.com/@arijs/vue@2.5.17-beta0.0/dist/vue.js"></script>
	<script src="https://unpkg.com/vuex@3.0.1/dist/vuex.min.js"></script>
	<script src="https://unpkg.com/vuebar@0.0.18/vuebar.js"></script>
	<script src="app/env/local.js"></script>
	<script src="app/services.js"></script>
	<script src="app/store.js"></script>
</body>
</html>
